const Step1 = ({ whichStep, setWhichStep }) => {
  return (
    <section className="coh-container section coh-style-section">
      <div className="coh-container section-inner">
        <div className="coh-container coh-container-boxed">
          <h1>Step1</h1>
          <Button {...{ whichStep, setWhichStep }} />
        </div>
      </div>
    </section>
  );
};

export default Step1;
